public class LoanCalculator {

    public BigDecimal calculateMonthlyPayment(BigDecimal loanAmount, BigDecimal interestRate, int loanTerm) {
        BigDecimal monthlyInterestRate = interestRate.divide(new BigDecimal("100")).divide(new BigDecimal("12"));
        BigDecimal powerFactor = monthlyInterestRate.add(BigDecimal.ONE).pow(loanTerm);
        BigDecimal numerator = loanAmount.multiply(monthlyInterestRate).multiply(powerFactor);
        BigDecimal denominator = powerFactor.subtract(BigDecimal.ONE);
        return numerator.divide(denominator, 2, BigDecimal.ROUND_HALF_UP);
    }
}

