 import java.math.BigDecimal;

public class StatisticsCalculator {

    public static BigDecimal calculateMean(BigDecimal[] numbers) {
        BigDecimal sum = BigDecimal.ZERO;
        for (BigDecimal number : numbers) {
            sum = sum.add(number);
        }
        return sum.divide(BigDecimal.valueOf(numbers.length), 2, BigDecimal.ROUND_HALF_UP);
    }

    public static BigDecimal calculateStandardDeviation(BigDecimal[] numbers) {
        BigDecimal mean = calculateMean(numbers);
        BigDecimal sumSquaredDiff = BigDecimal.ZERO;
        for (BigDecimal number : numbers) {
            BigDecimal diff = number.subtract(mean);
            sumSquaredDiff = sumSquaredDiff.add(diff.pow(2));
        }
        BigDecimal variance = sumSquaredDiff.divide(BigDecimal.valueOf(numbers.length), 2, BigDecimal.ROUND_HALF_UP);
        return BigDecimalMath.sqrt(variance, MathContext.DECIMAL32);
    }
}

